script: |
  super -f text -I q568.spq | sort > q568.out

inputs:
  - name: q568.spq
    data: |
      SELECT DISTINCT - 8 - - - CAST ( - col0 AS REAL ) + - col2 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 NOT BETWEEN NULL AND + - 13 + 18 + col2 * col1;
  - name: tab0

outputs:
  - name: q568.out
    data: |
